    addButtonsFormCaja() {
        $.fn.appButton.get({
            container: `#${this._alias}btn_add`,
            keymnu: this._alias,
            btns: [{keybtn: APP_BTN.ADD, type: 'button', evts: [{click: 'Obj.Facturacion.LocalAx.postAddCaja'}]}]
        });

        $.fn.appButton.get({
            container: `#${this._alias}btn_remove`,
            keymnu: this._alias,
            btns: [{keybtn: APP_BTN.QUI, type: 'button', evts: [{click: 'Obj.Facturacion.LocalAx.postRemoveCaja'}]}]
        });
    }

    setLocal(data) {
        Tools.setDataForm(this._formEdit, {
            alias: this._alias,
            elements: [
                {item: 'txt_codigo', value: data.codigo},
                {item: 'txt_descripcion', value: data.local},
                {item: 'txt_direccion', value: data.direccion},
                {item: 'chk_activo', value: data.activo, type: 'checkbox'}
            ]
        });
        this.setUbigeo(data.ubigeo_codigo);
    }
    
    setCajas(data) {
        let hS = '', hN = '';

        $.each(data, (i, v) => {
            if (v.marcado == 1) {
                hS += `
                <label class="checkbox">
                    <input type="checkbox" id="chk_caja${v.id_caja}" name="chk_caja[]" value="${v.id_caja}" ckecked="ckecked"/> 
                    <i></i> ${v.caja}
                </label>`;
            } else {
                hN += `
                <label class="checkbox">
                    <input type="checkbox" id="chk_caja${v.id_caja}" name="chk_caja[]" value="${v.id_caja}"/> 
                    <i></i> ${v.caja}
                </label>`;
            }
        });

        $(`#${this._alias}no_asign`).html(hN);
        $(`#${this._alias}si_asign`).html(hS);
    }

